    def crop_image(img):
        # Find non-white pixels
        non_white_pixels = np.column_stack(np.where(np.all(img < [235, 235, 235], axis=-1)))


        # Get the extreme coordinates
        leftmost = non_white_pixels[:, 1].min()
        topmost = non_white_pixels[:, 0].min()
        rightmost = non_white_pixels[:, 1].max()
        bottommost = non_white_pixels[:, 0].max()

        # Crop the image
        cropped_img = img[topmost:bottommost+1, leftmost:rightmost+1]

        return cropped_img
    
    lines = ground_1.strip().split('\n')
    image_1 = [list(map(int, line.split(','))) for line in lines]
    image1_array = np.array(image_1)
    ground_truth_1 = image1_array.reshape((175, 349, 3))

    lines1 = ground_2.strip().split('\n')
    image_2 = [list(map(int, line.split(','))) for line in lines1]
    image2_array = np.array(image_2)
    ground_truth_2 = image2_array.reshape((251, 435, 3))


    
    img=cv2.imread(path)
    temp=cv2.imread(path)
    # white_pixels = np.all(temp == [255, 255, 255], axis=-1)
    # temp[white_pixels] = [0, 0, 0]
    red_channel = temp[:, :, 2]
    non_white_pixels = np.where(red_channel < 220)
    average_red_value = np.mean(red_channel[non_white_pixels])


    if average_red_value >145:
        ground_truth=ground_truth_2.copy()
    else:
        ground_truth=ground_truth_1.copy()


    
    def image_similarity(img1, img2):


        hia=crop_image(img1)
        hib=crop_image(img2)

        hia = cv2.convertScaleAbs(hia)
        hib = cv2.convertScaleAbs(hib)





        

        try:
            gray11 = cv2.cvtColor(hia, cv2.COLOR_BGR2GRAY)
            gray22 = cv2.cvtColor(hib, cv2.COLOR_BGR2GRAY)

        except Exception as e:
            print("Error:", e)

        


 
        # resize to same size 
        gray1=cv2.resize(gray11,(300,300))
        gray2=cv2.resize(gray22,(300,300))

        
        ssi_index, _ = ssim(gray1, gray2, full=True)

        return ssi_index
    

    score=image_similarity(ground_truth,img)
    print(score)


    if(score>0.98):
        class_name='real'
    else:
        class_name='fake'  

    
    return class_name

    

         
     
